import React, { Component } from "react";
import Desire from "./Desires/Desire";

class DesireList extends Component {
  render() {
    const { desires_prop } = this.props;

    const tasks = desires_prop.map((desire) => (
      <Desire key={desire.id} desire={desire} />
    ));

    let wealthItems = [];
    let selfRealizationItems = [];
    let loveItems = [];
    let familyItems = [];
    let selfItems = [];
    let creativityItems = [];
    let knowledgeItems = [];
    let careerItems = [];
    let travellingItems = [];

    for (let i = 0; i < tasks.length; i++) {
      switch (tasks[i].props.desire.tag) {
        case 1:
          wealthItems.push(tasks[i]);
          break;
        case 2:
          selfRealizationItems.push(tasks[i]);
          break;
        case 3:
          loveItems.push(tasks[i]);
          break;
        case 4:
          familyItems.push(tasks[i]);
          break;
        case 5:
          selfItems.push(tasks[i]);
          break;
        case 6:
          creativityItems.push(tasks[i]);
          break;
        case 7:
          knowledgeItems.push(tasks[i]);
          break;
        case 8:
          careerItems.push(tasks[i]);
          break;
        case 9:
          travellingItems.push(tasks[i]);
          break;
      }
    }

    return (
      <div className="container">
        <div className="row">
          <div className="col-md-4">
            <div className="card text-center mb-2">
              <img
                className="card-img-top"
                src={require("../../../public/wealth.png")}
              />
              className="card-img-top" src="wealth.png" alt="Card title" />
              <div className="card-body">{wealthItems}</div>
            </div>
          </div>

          <div className="col-md-4">
            <div className="card text-center mb-2">
              <div className="card-header bg-primary text-white">
                <h3>SELF-REALISATION</h3>
              </div>
            </div>
            {selfRealizationItems}
          </div>

          <div className="col-md-4">
            <div className="card text-center mb-2">
              <div className="card-header bg-success text-white">
                <h3>LOVE</h3>
              </div>
            </div>
            {loveItems}
          </div>

          <div className="col-md-4">
            <div className="card text-center mb-2">
              <div className="card-header bg-primary text-white">
                <h3>FAMILY</h3>
              </div>
            </div>
            {familyItems}
          </div>

          <div className="col-md-4">
            <div className="card text-center mb-2">
              <div className="card-header bg-primary text-white">
                <h3>SELF</h3>
              </div>
            </div>
            {selfItems}
          </div>

          <div className="col-md-4">
            <div className="card text-center mb-2">
              <div className="card-header bg-primary text-white">
                <h3>CREATIVITY</h3>
              </div>
            </div>
            {creativityItems}
          </div>

          <div className="col-md-4">
            <div className="card text-center mb-2">
              <div className="card-header bg-primary text-white">
                <h3>KNOWLEDGE</h3>
              </div>
            </div>
            {knowledgeItems}
          </div>

          <div className="col-md-4">
            <div className="card text-center mb-2">
              <div className="card-header bg-primary text-white">
                <h3>CAREER</h3>
              </div>
            </div>
            {careerItems}
          </div>

          <div className="col-md-4">
            <div className="card text-center mb-2">
              <div className="card-header bg-primary text-white">
                <h3>TRAVELLING</h3>
              </div>
            </div>
            {travellingItems}
          </div>
        </div>
      </div>
    );
  }
}

export default DesireList;
